  false,\n\t\"url\": null,\n\t\"notes\": \"The Parker River National Wildlife Refuge
  provided an average of 1,411,000 duck use days during the 7-year period (1954-1960),
  with a high of 2,270,000 use days in 1957 and a low of 711,000 use days in 1953-
  Between 1956 and 1960 the highest fall population peak of 27,674 occurred in 1956,
  and the lowest, 6,725 in 1959- Average seasonal distribution of use through this
  period was January-April, 34 percent; May-August 8 percent; and September-December,
  58 percent. Species predominating are \"black duck, green-winged teal, mallard,
  blue-winged teal, pintail, and American widgeon. The black duck is far and away
  the most important. Use by diving ducks, principally goldeneye, greater scaup, and
  \"bufflehead, is negligible (under 3 percent). Duck production during the 7-year
  period has averaged 380. The year of highest production was 1957 when 640 ducklings
  were produced and the lowest was 1954 when 145 young were produced. The principal
  nesting species are mallard, \"black duck, \"blue-winged teal, green-winged teal
  and pintail. Primary management objectives are to establish and maintain habitat
  conditions capable of (l) supporting fall peak populations of 40,000 ducks and 3,000,000
  annual use days; and (2) producing at least 1,000 ducks each year. Emphasis will
  be given to devising techniques to increase production on salt marsh, as well as
  on fresh and brackish marsh areas.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
